import React from "react";

import LinkedIn from "../../assets/linkedin";
import Github from "../../assets/github";
import Twitter from "../../assets/twitter";

import withStyles from "./styles";

class SocialLinks extends React.Component {
  render() {
    return (
      <Grid item xs={4} className={classes.socialLinks}>
        <a
          href="https://www.linkedin.com/in/drew-blincoe-007b06b4/"
          target="_blank"
        >
          <LinkedIn className={classes.svgIcon && classes.link} />
        </a>
        <a href="https://github.com/dwblincoe" target="_blank">
          <Github className={classes.svgIcon && classes.link} />
        </a>
        <a href="https://twitter.com/BlincoeDrew?lang=en" target="_blank">
          <Twitter className={classes.svgIcon && classes.link} />
        </a>
      </Grid>
    );
  }
}

export default withStyles(SocialLinks);
